import "./Concepts.css";

const Concepts = (props) => {
  console.log(props);
  const items = props;
  return (
    <div>
      <ul id="concepts">
        {items.map((con, idx) => {
          <li className="concept" key={idx}>
            <img src={con.image} alt={con.title} />
            <h2>{con.title}</h2>
            <p>{con.description}</p>
          </li>;
        })}
      </ul>
    </div>
  );
};
export default Concepts;
